pragma solidity ^0.4.24;

contract Utility{




//*********************************************************** UTILITY FUNCTIONS **********************************************************************************


//The following function are needed for bits operation	
    
function shiftLeft(bytes4 a, uint32 n) internal returns (bytes4) {
        var shifted = uint32(a) * 2 ** n;
        return bytes4(shifted);
}
    
function getFirstN(bytes4 a, uint32 n) internal returns (bytes4) {
        var nOnes = bytes4(2 ** n-1); 
        var mask = shiftLeft(nOnes, 32 - n); // Total 32 bits
        return a & mask;
} 
    
   	
function allOnes() internal returns (bytes4) {
        return bytes4(-1); // 0 - 1, since data type is unsigned, this results in all 1s.
    }
	
    function negate(bytes4 a) internal returns (bytes4) {
        return a ^ allOnes();
    }
    
    // Set bit value at position
    function setBit(bytes4 a, uint8 n) internal returns (bytes4) {
        return a | shiftLeft(0x01, n);
    }
    
    // Set the bit into state "false"
    function clearBit(bytes4 a, uint8 n) internal returns (bytes4) {
        bytes4 mask = negate(shiftLeft(0x01, n));
        return a & mask;
    }	
	
	  // Get bit value at position
    function getBit(bytes4 a, uint8 n) internal returns (bool) {
        return a & shiftLeft(0x01, n) != 0;
    }

//Necessary to performs division with float	
function divide(uint numerator, uint denominator, uint precision) internal pure returns(uint quotient) {

         // caution, check safe-to-multiply here
        uint _numerator  = numerator * 10 ** (precision+1);
        // with rounding of last digit
        uint _quotient =  ((_numerator / denominator) + 5) / 10;
        return ( _quotient);
  }

  
function IsIncluded(bytes4 a, uint8 am, bytes4 b, uint8 bm) view internal returns (bool){
	bytes4 aa;
	bytes4 bb;
	aa=getFirstN(a,am);
	bb=getFirstN(b,am);
	if(aa==bb && am<=bm) return true;
	return false;
	}


function PrefCmpZ(bytes4 a) internal returns (bool){

for(uint i=0; i<a.length; i++)
if(a[i]!=0x00)
return false;
return true;
}


}
